  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lostwood
  Wetland Management District outlines District accomplishments during the 1976 calendar
  year. The report begins by giving a brief introduction to the District, as well
  as describing the climate and habitat conditions in the District, the land acquisition
  program, and system status. The construction and maintenance section describes physical
  developments and maintenance. The habitat management section discusses grasslands,
  forestlands, and easements for waterfowl management. Wildlife- including migratory
  birds, big game animals, and raptors- are discussed. The public relations sections
  describes information and recreation, recreational uses, and enforcement. Cooperative
  programs, items of interest, and safety are discussed. Photographs are attached.\",\n\t\"owner_org\":
